import data from "../json/painting.json";
import { Counter } from "./Counter";
import { Card } from "./Card";
import { Section } from "./Section";

export const App = () => {
  return (
    <>
      <Section title="Top Week">
        <Card data={data} />
        <Counter />
      </Section>
    </>
  );
};
